// ==UserScript==
// @name Audio Transcriber
// @description A script that transcribes audio from a data URL using the Web Speech API
// @version 1
// @author Copilot
// @match https://*/*
// @grant none
// @namespace https://greasyfork.org/users/670188
// @downloadURL https://update.greasyfork.org/scripts/488147/Audio%20Transcriber.user.js
// @updateURL https://update.greasyfork.org/scripts/488147/Audio%20Transcriber.meta.js
// ==/UserScript==

// Create a new SpeechRecognition object https://codepen.io/kyledeguzman/pen/KKZEKrL?editors=1111
var SpeechRecognition = SpeechRecognition || webkitSpeechRecognition;
var recognition = new SpeechRecognition();
recognition.continuous = true; // Keep listening until stopped
recognition.interimResults = true; // Show partial results
recognition.lang = "en-US"; // Set the language to English

// Handle the result event
recognition.onresult = function(event) {
  // Concatenate all intermediate transcripts
  var transcript = "";
  for (var i = 0; i < event.results.length; i++) {
    transcript += event.results[i][0].transcript + " ";
  }
  // Display the concatenated transcript in the text area
  document.getElementById("text").value += transcript;
};




// Start the recognition when the button is clicked
function start() {
  recognition.start();
}

// Stop the recognition when the button is clicked
function stop() {
  recognition.stop();
}

// Create a div element to hold the audio transcriber UI
var div = document.createElement("div");
div.style.position = "fixed";
div.style.bottom = "10px";
div.style.right = "10px";
div.style.zIndex = "9999";
div.style.backgroundColor = "white";
div.style.border = "1px solid black";
div.style.padding = "10px";

// Create a h1 element for the title
var h1 = document.createElement("h1");
h1.textContent = "Audio Transcriber";
div.appendChild(h1);

// Create a p element for the instructions
var p = document.createElement("p");
p.textContent = "This is a demo of how to transcribe audio from a data URL using the Web Speech API.";
div.appendChild(p);

// Create an audio element for the audio source
var audio = document.createElement("audio");
audio.src = "data:audio/aac;base64,";
audio.controls = true;
audio.autoplay = true; // Added this line
div.appendChild(audio);

// Create a button element for starting the transcription
var startButton = document.createElement("button");
startButton.textContent = "Start Transcribing";
startButton.addEventListener("click", start); // Added this line
div.appendChild(startButton);

// Create a button element for stopping the transcription
var stopButton = document.createElement("button");
stopButton.textContent = "Stop Transcribing";
stopButton.addEventListener("click", function() { // Added this line
  stop();
  alert(transcript);
});
div.appendChild(stopButton);
// Handle the end event of the audio element
audio.addEventListener("ended", function() {
  recognition.stop(); // Stop recognition
  start(); // Restart recognition
});

// Create a textarea element for displaying the transcript
var text = document.createElement("textarea");
text.id = "text";
text.rows = "10";
text.cols = "50";
text.readOnly = true;
div.appendChild(text);

// Append the div element to the body
document.body.appendChild(div);